В этом ролике мы рассмотрим основные варианты исполнения межкомнатных перегородок, материалы межкомнатных перегородок. А также укажем на основные достоинства и недостатки того или иного материала межкомнатных перегородок.

Рассматриваемые варианты межкомнатных перегородок:

- Межкомнатные перегородки из гипсокартона;
- межкомнатные перегородки из кирпича;
- межкомнатные перегородки из пенобетона, газосиликатного блока, гипсовых пазогребневых блоков.

Будут рассмотрены следующие характеристики:

- прочность межкомнатных перегородок;
- шумоизоляция межкомнатных перегородок;
- простота монтажа межкомнатных перегородок;
- влагостойкость межкомнатных перегородок;
- экологичность межкомнатных перегородок;
- огнестойкость межкомнатных перегородок;
